import {
    Button,
    Layout,
    Page
} from '@shopify/polaris';
import { TitleBar } from '@shopify/app-bridge-react';


class Login extends React.Component {
    render() {
        return (
            <Page>
                <TitleBar
                    primaryAction={{
                        content: 'Home',
                    }}
                />
                <Layout>
                    <Button url="/dashboard">Sign In With Instagram</Button>
                </Layout>
            </Page>
        );
    }
}

export default Login;
